Something lurks in the dark corners of space, something powerful enough to
kill a Reaper. Shepard races to discover the most closely guarded secret
in the galaxy before the Reapers silence it forever. Do you dare face
the Leviathan?

1. Unrar into your game installation directory. The game should be with
latest update (v1.03)
2. Play the game
3. Support the software developers. If you like this game, BUY IT!

As usual we recommend firewalling the executables, not using Origin, and
avoiding EA


